import React from 'react'
import { Line } from 'react-chartjs-2'

const DataChart = () => {
  return (
    <Line
      data = {
        {
          labels: ['Jan', 'Feb', 'March'],
          datasets: [
            {
              label: 'first',
              data: [3, 7, 4]
            }
          ]
        }
      }
    />
  )
}

export default DataChart
